import React from 'react'
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css'
import introPage from './introPage';
function App() {
  return (
    <div class='App'>
      <BrowserRouter>
          <Routes>
            <Route path="/" element={<introPage />} > </Route>
          </Routes>
      </BrowserRouter>
  </div>
  );
}

export default App;
